script: |
  super -f text -I q10759.spq | sort > q10759.out

inputs:
  - name: q10759.spq
    data: |
      SELECT ALL - + col2 FROM tab1 (FORMAT parquet) WHERE + col2 NOT BETWEEN + col0 + + - col2 AND + + CAST ( NULL AS INTEGER ) * - 18 + - col1 + - - col0;
  - name: tab1

outputs:
  - name: q10759.out
    data: |
